import './App.css';
import Header from './components/header'
import Carditem from './components/card'
function App() {
  return (
    <div>
      <div className='p-2 bg-black p-10'>
        <div className='bg-white text-black p-5 border rounded'>
          <Header></Header>
          <Carditem background={red}></Carditem>
        </div>
      </div>
    </div>
  );
}

export default App;
